import Motivation from '../components/Motivation'

const Results = () => {
  const style = {
    //Now working
    backgroundImage: `url(${background})`,
    height: "100vh",
    backgroundSize: "cover",
}
  return (
    <div style={style}>
      <h2 style={{padding:"80px"}}>Results & Recommendations</h2>
      <div class="result-content">
        <Resultitems/>
      </div>
    </div>

  )
}

export default Results
